import React from "react";
import Card from "./Components/Card";
import SDATA from "./SDATA";
let App = () => {
  return (
    <>
      <h1 className="heading_style">List of TV Serials</h1>
      {SDATA.map(
        ((val) => {
          return (
            <Card
              sname={val.type}
              img={val.image.m}
              title={val.summary}
              link={val.url}
            />
          );
        })
      )}
    </>
  );
};

export default App;
